INSERT INTO `TEXTS` VALUES (1,'AAl_13_1','The presented data shows us the percentage of people aged 65 and over in three different countries (USA, Sweden and Japan) in the second half of the 20th century and up to 2040. But what factory make the figures so varied?\nFirst of all, it is the average length of life. Japan is well-known for its long-living people , and that is why the proportion of them is expected to excud 25% by 2040. However, the economic situation has not always been so brilliant , moreover, it was much worse there then in Europe and America , so the number was relatively low until the expected acute rise in 2030. Also, that is due to the fact that more children are born in Japan , and as a result, they take up some *space* in the generations division. \nSecondly, it is social policy that afects the quality of life. After the introduction of state insurance and pensions both in the USA and Sweden , more elderly people were able to afford suitable medical treatment, housing or other benefits. Another option is the decline in the number of children per family. More and more young people decline to start a family later anf have only 1 or 2 offsprings , and this tendency will certainly bring about the growth of the proportion of the elderly people, as those born in 1975 are 65 years old by 2040.\nTo draw a conclusion, we may say that not only social or economic tendencies , but also government policies might cause certain changes in social proportions , consequently, these policies and tendencies should be accurately governed.\n','best'),(3,'AAl_30_1','The diagram presents a number of people after 65 years old in percentage from number of all people. The indicators are devided on 3 groups with countries: Japan, Sweden and USA, and shows changes in the 100 year period from 1940 to 2040.\nThe population aged 65 and over from Japan was only 5 percent in 1940. Then there was slightly decrease for 20 years period and it was a constant next 20 years . After 1980 it become to increase slightly. According to graph this increase will be continued and in 2030 will go up dramatically to 25 percent.\nIn Sweden the number of people in 1940 was about 7 percent. Between 1940 and 1980 this number was increasing. After that there was slight fall and than sharp rise. The same situation will be between 2010 and 2040. The numbers will reach almost 25 percent.\nIn the USA there were almost 10 percent aged people in 1940. Between 1940 and 1980 it was a little more than in Sweden . After 1980 the indicators were stable and after 2020 will rise to 23 percent in 2040.\nTo sum up, it can be seen from the graph, the number of people aged 65 and over increase and will reach the number nearly 25 percent to 2040 in all countries.\n','best'),(4,'ZEv_3_1','The charts provide information about travelling abroad by Englishmen and visits to the UK by foreigners from 1979 to 1999 as well as the most popular countries which UK residents went to in 1999.\n	Due to the charts, UK residents travelled to the other countries more than overseas residents visited UK. Moreover, there were two most visited countries by the English which were Spain and France.\nTo look more precisely at the first chart, there was slight difference between numbers of UK travelers and foreign travelers in 1979, which accounted approximately 13 millions and 10 millions respectively. This difference had increased substantially by 1999, making up to 28 millions and 54 millions respectively.\nDue to the information about the most preferred countries by the English in 1999, the most popular ones were France and Spain which are visited by 11 millions and 8 millions people. USA was the third most visited country (roughly 4 million of people), while Greece and Turkey were the forth and fifth ones (3 millions and 2 millions respectively).\nOverall, the UK residents were more active travelers than foreigners in the UK in period between 1979 and 1999.\n','best'),(5,'EEm_14_1','The given graph depicts the changes in the percentages of the people aged 65 and over in the time period between 1940 and 2040 in three countries.\n\nThe first visible trend can be found if we compare the growth dynamics of elderly population in Sweden and USA. In 1940 the percentage of these people in USA was close to 10% while in Sweden it was about 7%. From then on the figures of these countries grew steadily until 1995. In that year the percentage of population aged aged 65 and over rocketed in Sweden hitting the maximum point of 20% while the same trend stayed in USA. It is predicted that their percentages will narrow in the 2020’s but the USA will not be able to keep up with Sweden.\n\nUp until the early 2000’s the percentage of elderly people in Japan was fluctuating, falling to the lowest point between 1960 and 1980. But then it grew steadily and it is highly possible that it will rise sharply up to more than 25% in 2040.\n\nOverall it is clear that while Sweden and USA share the same trend features, Japan, after the years of low percentage rates, will catch up on other countries.\n','best'),(6,'EEm_16_1','The graph represents the share of the elderly people in three countries: Japan, Sweden and USA over the period between 1940 and 2040.\n\nIn Japan, the proportion of elderly people is the lowest out of three countries and stays under 5% up until the beginning of the 2000s. However, there is an upward trend since the end of the 1990s. In 2030 the procentage line goes up almost vertically and reaches the maximum of roughly 27% by 2040.\n\nThe USA and Sweden rising trends are similar with insignificant differences until the end of the 1990s. The rate of the increase changes by approaching the new century. The USA figures grow slowly and steadily after 2020 with the «plato» period of 20 years before that. Sweden people aged 65 and over experience a sharper increase with dramatic fluctuations, joining the consequential rise after 2020.\n\nThe overall tendency is the increase of the number of the elderly people to the population of the country in general. In Sweden and USA the original proportion of the elderly people doubles, while the Japan figure rises in 5 times.\n','best'),(7,'KKo_9_1','The given pie charts provide the information on the percentage of differently aged people in Yemen and Italy for 2000 and the prediction of how this percentage will change in 2050.\nFirst, let’s take a look at the ages of population of both countries in 2000. Almost a half of Yemens population is taken over by the children from 0 to 14 years, while this age group in Italy covers only 14%. The other half of Yemens population consists of 46% of adults and only 4% of elderly people. However, in Italy adults present the biggest part in population – almost 62%. And the elder part is not small too.\nThen, looking at 2050 pie charts for both countries, we can see that the elder population in Yemen will not increase much, while in Italy there will be almost twice more elders. The number of people aged 0-14 years in Yemen will considerably decrease, leaving place for adult population, which will grow up by 11%.\nTo sum up, we can clearly see that Yemen has tendency to have more young population, while Italy has more representatives of elder age groups. And in 50 years the ages of population of both countries will change consequently.\n','best'),(8,'KKo_24_1','The chart shows the information about total minutes (in billions) of telephone calls in the United Kingdom from 1995-2002 divided into three categories: local and national/international fixed line and mobile calls. We can see from the chart that local calls are the most popular and mobile calls are less popular throughout the period, but the situation tend to change, as mobile calls, having relatively low numbers at the beginning of the period from 1995 to 2000 rapidly become much popular during 2000s. with almost 10 times more minutes of calls in 2002 than in 1995. National and international calls have a steady increase in the number of call minutes throughout the period, paining about 2-5 billions a year. Local fixed line calls had a peak in 1999, steadily rising until this year and starting to lose positions at almost the same rate after.\nIn general, we can see an increase in total number of call minutes, and mobile calls have became significantly more popular in 2002 than in 1995, while other types of calls have ether a relatively moderate increase, as national/international telephone calls, or maintaining almost the same number of minutes in 2002 as in 1995 (local fixed line calls).\n','best'),(9,'ASt_21_1','The table provides data concerning underground railway system of six cities. The description of each includes information about the date it was opened, how log is its rowte and kilometers and, also, how often people use it during a period of a year. The last one is given as passengers per year and it is counted in millions of people.\nFrom the table we see that, out of six cities, London was the first to have its own underground railway system. It was opened in 1863 and now it is also the one with the longest route, which counts up to 394 kilometers of tracks. However, it*s passenger density is not the biggest and it is less than half of the same parameter of Tokyo, where the number of passengers per year reaches 1927 millions. This is despite the fact, that there length of route sums up to only 155 kilometers.\nThe city of Koyoto seems to be an outsider it this comparison, as it has only 11 kilometers of tracks and, on average, no more than 45 million passengers of this means of transport between European countries and United States of America.\n','best'),(10,'ASt_34_1','This table shows the information about subway systems in six different cities. Overall, London Underground railway system is the oldest and longest one while the system of Koyoto city is the shortest and the most unpopular to use.\nIt is notable to see that the majority of these underground railway system opened in a previous century except the subway systems in London (XIX century) and Los Angeles (XXI century). The length of these systems in Paris, Tokyo and Washington DC fluctuates from 100 to 200 kilometres while the longest route is situated in London (394 kilometres). However, the system of Koyoto and Los Angeles are really short. Moreover, the underground railway system of Tokyo is the busiest one because 1927 million of passengers visit it every year. The metro in Paris has a high rate of passengers per year too. On the contrary, Koyoto and Los Angeles subway systems are modern and not so popular to use: 45 and 50 million of passengers each year.\n','best'),(11,'12_1','The line graph illustrates the figures in global smartphone sales of four different brends between 2010 and 2015. The overall trend of Apple profits is obviously upward, while Blackberry and HTC shows the downward trend. Moreover Samsung`s rate trends to be downward too regardless some eratic movements. \nThe percentage share of Apple profits dramaticly increases from 2010 to 2012, starting at the level of 40% and reaching 70%. After a slight fall in 2013 down to 60%, it markably goes up again through the rest of the period. Similarly to this, Samsung`s rate of profits gradually rises over the first three years from the amount of approximately 15%, hitting a pick of about 43% in 2013, and significantly drops at the second part of the period, on the level of less than 15%. \nAs or numbers, referring to Blackberry and HTC profits, they start in the region of 10%, show some fluctuations and have a slow but steady decline through the next couple years. Both these brends reach about 5% by the end of the period.\n','best'),(12,'13_1','The given charts presents information on the number of boys and girls from different regions without access to primary school in 2000 and 2012.\nGenerally speaking, the total amount of such children decreased in every region. Still, Africa has the highest rates in 2012, as well as in 2000. Also it is noticeable that in both years there were more girls without access to primary school then boys, despite the fact that in 2012 everywhere but in Africa the situation was the opposite (more boys without such access). The most dramatic changes took place in South Asia, where the number of these children fell down by more then 3 times form 32,7 millions to 9,9 which is the lowest rate in 2012. What is interesting, the number of girls dropped by nearly 4,5 times, whereas the number of boys declined only by 50 per cent. But this is still not enough to change the situation where boys is general have more opportunities in case of primary education.\nAll in all, the global trend gives a hope that there will be more children with access to primary schools in the future worldwide.\n','best'),(13,'AAl_2_2','Due to the principles of the International law there could not be any discrimination. So, males and females have equal rights nowadays in all spheares of life. This rule also concerns educational process their all people have a right to have an education, besides, they are free to choose any subject they want. Moreover, is it appropriate for universities to accept  males and females in every subject equaly?\nFirst of all, if we speak of equality of men and women we should make a notice that this also mean that women could not do some work which is not suit them (take heavy things). In other ways it is known that females can choose freely their profession. Secondly, we can easily think of jobs which will be more priority for males such as military professions.\nWhat is the goal of setting the rule when universities accept equal numbers of male and female students in every subject? Will it really provide equality? It is set by the laws that everyone has an opportunity to study the subject he prefers. This rule is enough for the realisation of the principle mentioned above.\nAnother factor which may be set against that rule is a different propostion of population of males and females in the country. It would be hard to reach equal numbers because women simply can be more than men or overwise, so this argument makes that rule almost impossible.\nOf course universities may try to bistribute makes and females during educational process in different groups equaly and that probably will bring positive result. \nTo sum up, everyone both males and females has a right and opportunity to choose their profession and study in a place they want. It will not be appropriate for university workers trying to choose students by the criteria of equality of males and females instead of professional qualities and knowledge, which may have every person. \n','best'),(14,'AAl_13_2','The question of gender equality in all spheres of social life has become very hotly discussed in the resent decades. One of the most important factors that constitute a future professional *profile* of every individual is, of course, higher education. Providing society with strictly similar numbers of male and female graduates in each subject would certainly change the labour market as well as academic world. But will these changes be for the better - or for the worse?\nThe first point to fear in mind is that nowadays students are accepted on the basis of their performance during entrance examinations. That means: only previous qualifications and / or knowledge of each applicant is taken into consideration. Is it fair to give preferences to this or that young person because of their race, religion or gender? No, this will mean discrimination , and that is the inevitable consequence of *gender-based* intake of students.\nExtremely alike reform has been carried out in Germany. The universities are obliged to hold different entrance lists for man and women with different entrance marks. As a result, it may be easier for a male to gain acceptance to a medical school (with 1.3 entrance mark in comparison with female 1.1). I do not think that is *fairness* in the proper sense of this word.\nThe only aspiration of this reform I agree with is the feeling that certain fields of science or work are traditionally *male* or *female*. Although I don*t believe that *maxing* of sexes should be caused by such a radical method , I think that young girls and boys should be encouraged to take up any profession they are into, no matter if it is supposed to be men- or women-only occupation. \n','best'),(15,'AAl_26_2','Today there is a great number of discussions about male/female relationships. One of them is should male and female students work together and even more - in equal numbers. Some people lelieve that it*s inappropriate , to make universities accept equal numbers of male/female students, others agree that it will improve current situation in education. \nThere exist strong arguments of both sides of this disscussion, which implies that it is worth examining all points of view before reaching any conclusion. \nFirst of all, there is a necesity to say that one of the advantages of these type of accepting students is the equallity between men and women. Equall numbers mean equall opportunities for people, without discrimination sexes. Moreover, there is a plenty of scientist*s researchs convincing that working between male and female groups of people in equall proportions gives a much more favor. Also, this type of proportion helps members of each group interact with others easily, that when there is a disproportion.\nAnother point of view is that such type of accepting students is useless and pointless. Supporters claim that such thing can destroy the real competition between students, which is based on knowledge, not on female / male you are or not.\nAnother drawback of equall accepting numbers is that it can crushed all system of university*s academic freedom - government will give concrete numbers of students , who schould study in universities. And one of the most convincing arguments againts equall proportions between male/female students is that there is no any correlation or connection between knowledge and which sex do you have. And I am firmly believe in that. Since the Medievel times, people fight against discrimination, for modern society with equall rights for everybody. And for the first time, this meosure for accepting equall numbers of students seems like justice, lut it is not real suitable criteria for competition between students. There is no shame if men are good at law and women in teaching as there is no any discrimination between them in case of disproportion.\nConsidering all arguments , it can be concluded that the idea of universities accepting equal number of male / female students is not good of all.\n','best'),(16,'AAl_27_2','There is an opinion that universities should consist of equal parts of men and women, because society should give the same rights and possibilities for both sex. I can*t agree with this opinion.\nFirstly, undulation should not depend on sex. The main criteria is personal abilities and way of thinking. If universities had accepted equal quantity of students in 16-19 centuries despite of their mental activity, modern society would never have industrial machines, planes and cues just because young scientist , who had innovating ideas , were not accepted university.\nSecondly, there are a lot of professions which require some physical or psychological features from warheas. It depends on character of work, its aims and audience. For example, it*s really difficult for men to work at women*s consultation centre because both doctor or client would be embarrassed. Besides, women would have problems working as machinery operator because sometimes, it*s necessary to repair huge machines quickly to prevent the catastroph. The majority of women just do not have such strong organism and muscles.\nThirsty, such equality would negatively affect not only a person, who was not accepted by university , but also a person , who was. It would happen because student of university will be scere that employes would accept them equally like the university. However, such students do not pay attention for the fact that employers will take the smartest students. As a result of this equality students lose their ability for competition.\nAll in all, university is \"a factory\" of knowledges, research and new inventions. We should not create barriers for ahibitious persons and accept persons, who doesn*t have interest in education, just because of sex equality. If it would happen, the development of science and society*s culture will stop.\n','best'),(17,'VKo_2_2','One of the inevitable human rights is freedom of speech. Considering any form of art a way to speak about something hardly anyone can make any restrictions without breaking the essential human rights. Meanwhile I think it is necessary to give all the freedom to any artist, it still seems fair to me that piece of art can somehow hurt other people, so the government restrictions can be used only for protection but not for limiting one*s will to express himself.\nDue to the fact that contemporary art is developing and becoming more and more extraodinary, some people can say that the government should restrict such perfomance that can somehow hurt feeling of other people. The scandalous organisation \"Pussy Riot\", which had punk pray in the cathedral, is still being discussed. All the people are divided into two fighting groups; one is proclaiming that this perfomance is a form of modern art aimed to express the political protest, and another group is sure that the punk pray is nothing but only an attempt to hurt the feelings off religious people and descrinate the faith. However, freedom of people to express their own is a constitutionally proclaimed right of everyone so no one can be deprived of it. More to say, throughout the centuries all the artists (musicians, painters, poets) have struggled for their freedom to be heard.\nTherefore, it seems to me like it is not the government who can somehow restrict the artists* freedom to express themselves. The only rules that can somehow be excercised must be created only by the common will of society, so these rules will become some moral orientiers for artists in order to make it more easy to distinguish where the expression of themselves can hurt anyone else.\n','best'),(18,'VKo_3_2','There is an opinion that creative people like artists, writers and so on should have the freedom to express their ideas in whichever way they may wish and governments should not barrier their activities.\nAs for me, this point of view is absolutely wrong. First of all, if governments allow people who call themselves artists to express themselves in whichever may they like, that will provide an unstoppable chaos because than anyone just by proclaiming that he is an artist will have a liberty to do whatever he likes calling his actions an art. Furthermore, I believe that governments should provide order and order  is only achieves by control. Governments which can*t provide control may lose a respect of their citizens and, which is much worse, legitimacy. For example, last year one so called artist clipres his testicles to the ground at the Red square as an act of protest against Russian government. As for me, I doubt that this is an acceptable way of self-expression.\nThere is an another argument: providing such freedom to artists conpredicts the basic principles of the democracy. According to the liberal position, no group should have preferences in their social rights, everybody must be equal, no mater who those people are: buisinessmen, labors or artists. If society gives preferences to some group they means that this group may avoid rules which influences freedom.\nIn conclusion, I*d live to state one more time that artists should not be out of restrictions on what they do because it is immoral and unfair to other social groups and also because this may put society in a dangerous situation.\n','best'),(19,'VKo_5_2','Some people argue that creative artists are given too much freedom nowadays, while others think that self-expression can*t be limited with any kinds of rules. I suppose that artists should be able to create whatever they want. Nevertheless there have to be some restrictions related to showing it publicly.\nFirst of all, some artists don*t have any boundaries and a lot of people love their works. However, these pieces of art can be harmful for children, because they are very sensitive and they percept everything they see. That*s why it*s reasonable to prohibit children to watch some films, visit some exhibitions and listen to some pieces of music.\nSecondly, I have mentioned earlier that these restrictions should not be too serious. It means that artists should have their right to create anything they want. If a child gets access to prohibited pieces of art it*s not the fault of an artist.\nAlso I believe that the grown-ups are able to decide themselves whether to read a book or not, whether to go to an exhibition or not. Even if they are shocked by the way an artist expresses himself they can deal with it. That*s why the adults shouldn*t not be restricted from getting acquomted with this or that piece of art. The only limit has to be the dignity of other people. I think that it concerns some kinds of installations.\nAll in all, it seems to me that people are free to express themselves. On the other hand, they need to remember that they are not the only ones who will see their creations. The restrictions are to focus on protection of children and dignity of other people and not on some political matters. These restrictions should not be similar to censorship.\n','best'),(20,'VKo_9_2','Nowadays the question of self-expression is being widely discussed, because of spreading the government restrictions on it in Russia. To my mind, there should not be official restrictions from our government, but there should be inner moral rules about what somebody can or cannot do.\nFirstly, I have to say that nobody can stop our imagination creating different ideas, and government restrictions will not make us do it. They can only make some types of arts illegal, but it does not mean that these types of arts will die out. If government gives us freedom to express our ideas, there will be more orginized events and festivals. In this way government will show that it trusts it*s nation.\nBut I should notice that some types of arts cannot be shown to the children, because it may hurt their feelings or minds or be really unacceptable for this little age. I want to say that we should protect young consiousness from harmfull effect.\nBesides, I believe that expressing and watching are different things, that we cannot combine in our discussion. I guess that everybody has a right to express what he thinks or feels, but everytime a person should remember that he can upset his relatives or friends. Everybody has different views on music, politics, art. We should be tollerant and respect an opposite point of view.\nTo sum it all up I want to say that everybody has to dicide for himself if he can express something, which is inside of him, or cannot. For me, it is more important to have inner restrictions than have useless government rules which try to control our modern art.\n','best'),(21,'VKo_12_2','They say creative people should be free to express their creativity in any way they want.\nIn my personal opinion culture and art is certainly an inceporable peace of our everyday life. So those who create genuine art are [ir?]tal for the soeciety to develope in the right direction. Though, creative artists are obviously should feel free to express themself in all ways of art like literature, cinema, painting etc., they still should have some moral boundaries, not necessary provided by government. I do believe that everyone should know the difference between expressing themselves and total limitless egoism. Especially when those artist want the audience to see or to hear their masterpience. What I mean is art can not be associated with insulting others, making harm to others even if the Creator suppose it is how He sees the world. For example, a famous singer is writing a rude song about his enemy or a person he just dislikes. As soon as the people hear this song, they will have prejudices against this person without even knowing him/her.\nMoreover, sometimes so-called art can have some inappropriate content, it can be inappropriate for children, for instance. This is when the government can interfere and put some age restrictions.\nAll in all, I understand that artist are free spirits, though I still stick to the idea that the genuine (which is very important) art and the rules of morality and tolerance should compromise in order to prevent chaos and misunderstanding.\n','best'),(22,'VKo_21_2','Creativity is the sphere, which might always be free from government and law restrictions in reason to be able to express artists* own view on art. To what degree it is true?\nFrom my point of view, the art is a personal and intimate phenomene. That is why creative artists should be free from limits and boundaries. The main argument in favor is that It represents art trends and tendendies of modern generation. This cause leads us to another reason. Freedom in art expression helps present art to create the history. There is no doubt, that government restrictions erode genuine creativity and make current art biased.\nOn the other hand, some people believe, that power limitations will help to control expressions of modern art, because sometimes it is neccessary. There are a lot of examples, when products of some creative artist over-step the law. Moreover, some art expressions break the moral  principles by propaganding non-ethic (sometimes violent) ideas. However, I tend to think, that such activity and its different, non-typical views seem to be only another, distinguished lifestyle, which doesn*t mean immoral expressions, but conceptual.\nIn conclusion, I would like to stress, that creative artists will always exists, and different opinions on freedom of their expressions will also exist. However, It*s up to you to decide, what to think about it.\n','best'),(23,'VKo_24_2','Nowadays, there are many heated debates about whether government restrictions should exist and control what creative artists are allowed to do or whether we should give freedom to those artists to express in a way they want. Personally, I absolutely agree with the first point of view due to some reasons.\nFirst of all, to my mind, it is absolutely important to control every sphere of our life, if it is not under a certain amount of control, there would be a disaster. Consequently, by giving the freedom to creative artists to express themselves as they want will definitely lead to certain problems. For instance, it would be almost impossible to keep an eye on a censure, because some artists have got an extraordinary views on art.\nSecondly, many unofficial films, pictures etc. will appear. Hence, it would be veryhard to control this big flow of pirate movies, not officially recorded songs. Therefore, it will lead to more people who break the rules and the rate of crime will grow.\nOn the other hand, many people may say that we have to think about the freedom of expression. While speaking about this theme. Although this opinion makes sense, little to these people realize how many disadvantages will appear when government restrictions are off.\nTo reteirate my point of view, I do believe that everything in this world should be under the control of something whether it is government or parents, because without restrictions we will not be able to live a sedate life.\n','best'),(24,'VKo_29_2','Many years ago government could punish some creative people when their ideas did not support power*s way of managerment. Today artists have the freedom, but sometimes government can restrict their ideas. I am convinced that creative artists should not be restricted.\nIn my opinion, politics and art do not have the same reasons. The function of government is regulation of social, economical and political relationships in society. Art is another world that gives up an opportunity to think and live as we wish in our fantasies.\nIf creative persons forget their freedom to express their ideas, we will not see the new kinds and trends of art. Modern life is very dynamic, it changes very fast. Yes, we have many wonderful pictures of 18 century, we can listen to classical music and watch old films. But, despite of it, we need more genius compositions.\nWe know that some of modern songs, films, cartoons and pictures have the signals of revolution. Power afraid of this trend, because modern art can influence the society more then government. Without any doubt, sometimes it can be useful. Power corrupts. Art is indicator of people*s opinion, and people can influence government.\nFreedom is a criteria of democracy. Democracy is the main idea of modern life, that is why today everybody can express his ideas the way he wants.\nBut some people have an opposite viewpoint. They sure that modern painters and singers are very free, that is why their expression is ugly and can influence children and polite people bad way. I think that these people are afraid of changes in modern world.\nArt is long, life is short, that is why freedom should be the main criteria of modern art, because we need the new ways of expression.\n','best'),(25,'VKo_34_2','That won*t be an exagerration to say that art is what makes our life brightful and fills it with beauty and emotions. It often touches upon social problems and a lot of people of art are sure that the main purpose of their activity is to reveal these problems and to draw public attention to them. They are eager to deliver their position and express themselves through art.\nHowever, they often face censorship. Even in the age of Ekaterina the Great it was forbidden to write about the issues those contradict the policy of the monarch. Ekaterina ordered to burn all the the book \"The travelling from St. Petersburg to Moscow\", which depicted the poor life of the peasants. Censorship exanded in the Soviet Union, a lot of information was hidden from the citizens of our country. Even when the Chernobil accident happened not all the inhabitats of Pripyat were informed and evacuated, so it can lead to terrible consequences.\nThese examples show that a freedom of speech and a freedom to express your ideas are of essential importance. I strongly believe that the government should avoid approving any bills that can restrict people say what they want. Any bill passed for the sake of creating phrames and bourders for journalists, artists, musicians doesn*t bring a benefit to the society. Evidently, these measures are aimed at contributing to the strength of the authorities only. The fact is that the restrictions haven*t ever been objective. All the views should be expressed, everyone has a right to be heard, and the public is to decide wheather to agree with a person and his opinion or not; not the government should make a decision.\nAll things considered, I am sure that censorship brings disadvantages to the society only and all the possible views should be presented to the public.\n','best'),(26,'ZEv_3_2','Nowadays behaviour of students is becoming a burning issue in several schools all over the world. School children neglect many school rules as well as miss a lot of classes. That is a tricky question why it happens and what can be done to improve this situation.\nThere are several possible reasons for that problem. First of all, the main cause of bad behaviour is teenagers` nature. Children in difficult age are always supposed to protest against rules they do not conform to. There is nothing to do in order to improve that type of nature, but some changes can be done. As far as I am concerned, the most important thing is to give teenage students  to develop culturally by giving them more lessons on arts, culture and so on. At the same time, teachers should understand what is needed for young people and respect their wish to show individuality, to set up their own rules and so on. That type of teachers` behaviour can lead to mutual understanding and improving situation. \nSecondly, one another reason for the problem of bad behaviour us that students are not involved in the process of education and not interested in getting new knowledge. That is a result of boring classes and the fact that children are not informed how they can use that knowledge. That is why students miss classes being sure they are unresourceful. The possible solution for it is to explain them why every course is important and what is the main purpose of it. For instance, as children understand the importance of knowing biology for future doctors, those who want to become a doctor learn it rarely. Moreover, teachers should make their lessons more interactive and capturing. These actions are to assure children not to miss classes and to encourage them to learn, which is likely to result in their behaviour. \nTo sum up, I would like to add that some actions are able to be done to improve the situation of bad students` behaviour even if causes are difficult and lie in the very nature of young people.\n','best'),(27,'EEm_14_2','With the rise of the popularity of the higher education and the realisation of the number of job opportunities it offers to young people the question of gender division has come to the minds. It is necessary to provide the students of both sexes with an equal amount of places on each faculty, or can some certain gender traits have an impact on that proportion?\n\nIn my opinion it is important that the universities provide both male and female students with an equal access to the exams and faculty places. It is clear that nowadays women have become more confident and are not afraid to participate in the competitions with their male counterparts. Right after the 19th century feminist movement women acquired many rights firstly reserved specifically for men, including the right to study. If a woman can study in the chosen field she can make a good career for herself applying her knowledge appropriately.\n\nAlso the division of subjects on «male» and «female» ones is quite ridiculous as it doesn’t consider the talents of each given individual. If a man wants to be a poet or a designer or a teacher it doesn’t that he will grow to be less masculine in the same fashion as the woman who chooses to study engineering or mathematics doesn’t lose her femininity. Everyone should be able to follow their dream and the faculty choice is the first step towards its relation.\n\nOn the whole I argue that all the universities should decide weather to allow or not each given student to study in the certain subject judging not by their gender but by their knowledge and eagerness.\n','best'),(28,'EEm_16_2','There is an opinion, that every subject in the university should be studied by an equal amount of males and females. However, I can’t fully agree with this suggestion.\n\nOriginating from feminist studies and the equality of human rights, the idea of splitting university courses in equal male and female parts seems absurd to me. The same rules and demands, imposed on university applications, regardless of the candidate gender, already become a garantee towards fair university choices.\n\nMore than that, any university is highly interested in the most talented students, despite the student;s gender. In case university admits the «half and half» proportion for the subjects, it may restrict some gifted applicants from either side.\n\nNext, there are subjects that considered to be traditionally feminine or masculine. For example, there is a clear feminine dominance in the sphere of children’s education: kindergardens and schools, whereas in the labour domains where physical force is required, the preference is given to men. Males and females are different physically and phycologically, thus they suit better for different occupations.\n\nNeedless to say that males and females have different social roles as well. The university subjects requires corresponding climate and artificial division in halves won’t serve to the best of the atmosphere. It’s much more interesting to study with people who are encouraged and curious about the subject than with ones that were taken the form the equal proportion.\n\nTo sum up, I would like to say that history knows many examples of outstanding scientists of both genders. For the university, the prime concern should be on student’s motivation and eagerness to develop, the gender doesn’t matter. However, the equal conditions of entry and fair competition of candidates is of high importance. The university courses should form naturally, not artificially in order to provide best productivity.\n','best'),(29,'MTsy_6_2','Salatkina Maria\nСПб\n28.03.14\nменеджмент\n13-00\n311\n\nTASK 2\n	There is no rout that the main value in everybody*s life is heath. However, despite the accessment of heath insuarance and the development of science and medicine, public health is getting worse. Someones claim that it is necessary to rise the number of sport activities at schools and universities. Others argue that this way would not dramatically change the situation and there are other methods to solve the problem.\n	On the one hand, sport exercises help people to keep feet and therefore to decline the ability of having health problems. If a person does not pay enough attention to sport, it can lead to obesity and heart diseases. Moreover, sport activities provide good heath and as a result people do not have to spent time on visiting doctors and wasting money on different expensive medicines.\n	On the other hand, the problem with public health can not be solved only by increasing the number of sport facilities. The government should transform not education, but health insuarance system. Drinking alcohol and smoking should be forbidden not only among teenagers but also among their adults. The healthy lifestyle are required to become popular with the help of newspapers, television, the Internet and other mass media instruments.\n	To draw a conclusion, I am convinced that both view are likely to take into a consideration. In my opinion, improving public health is impossible without strong governments* action. More than that, everyone should be respovsible about his health and try to reduce work pressure and to find time on sport activities.\n','best'),(30,'KKo_9_2','Public health has always been an urgent topic. Nowadays when peoples health is affected by different dangers, caused by the development of humanity, this topic is especially problematic. Scientists and politicians have quarelled about the best way to improve public health.\nSome people think that creating more sports facilities will help, while others don’t agree with it. In this essay I will discuss different opinions.\nAs it was written earlier, some people suggest building more sports facilities. They state that more people will visit gyms and swimming pools if there will be more of those. For example, it will be more convenient for some people to go to the local gym than to travel to another side of the city and backwards.\nOn the other hand, some people say that it is all about encouragement, not convenience and availability. They argue that people should be encouraged to visit sport centers and to watch over their health. If it will be so, governments will not have to spend money on extra sports facilities. Money will be spent on the improvement of healthcare and older sport facilities to make them suit the needs of people.\nAs far as my opinion is concerned, the main target of any social state is to maintain proper level of health and welfare of it’s people. That’s why not only new sport facilities should be created, but new hospitals and medical centers. Then, to suit the number of these facilities, a lot of professional doctors and medical personnell should be “grown up” in the state’s universities. All these methods will help one state to provide sufficient healthcare for it’s people. All in all, public health, the level of which has lowered through previous decade, should be taken care of. If all the policies I have brought up in this essay will come true, the level of public health will increase and with it, nation’s welfare.\n','best'),(31,'KKo_24_2','There are lots of discussions these days about high school programmes. People want to give their children the best possible education, so they are widely discussing the education standards, programmes and lows, but there is some thinking to be done about events and activities happening outside the class, for example, some people believe that one of compulsory parts of high school education should be a unpaid community service, which involves working for a charity, improving the neighbourhood and other.\nIn my opinion, having such project as s part of high school education is a really good idea. Students will gain a lot of experience which will help them during their lives, an experience they would never receive in the classroom. They will have a chance to work and communicate with different people, not only gaining useful knowledge and experience, but also improving their socialization and communication skills. This programme would also be benefitable for the charities, which  often don’t have enough people to achieve their goals, and for the whole community in general.\nThere are also people who don’t want their children to participate in such programmes. Possible reasons for that include these: by the first, such activities may take a lot of time and concentration, thus reducing the quality of education as students will have less time to spend doing homework or revising the material. By the second, some families may be concerned about the fact the service is meant to be unpaid, not allowing students to gain some work experience and earn some money.\nIn conclusion, the idea to have an unpaid community service as compulsory part of high school programmes seems really appealing to me, because not only students will benefit from these activities, but also the whole community and society. \n','best'),(32,'LPo_16_2','Nowadays some people are sure that men and women must be accepted by universities in equal proportions. On the other hand, some people claim that universities should not take such measures. I totally agree with latter for the following reasons.\nTo begin with, it is wide known fact that males can succed in certain spheres of knoweledge whereas women – in other. What is meant is that there is a kind of a tendency that men prefer mathematical studies such as engineering, computer science, some IT-branches, while women would rather choose, for instance, social science like sociology or politology; foreign languages and literature. So, it would be wrong to force a man to study sociology if he feels that he might be more satisfied and successful studying math. Some might argue that both males and females become doctors, but I am convinced that, for example, the greatest surgeons are men.\nAnother point for not establishing such laws is related to future professions of students and their position in social structure of our society. In some kinds of jobs employers are willing to employ only male, for instance, in IT-companies because, as far as it is believed, men are able to manage with analyzing big amount of information, they are more punctual and they could seldom be stressed. Turning to some female professions. It is worth noticing that women are more required in such sorts of jobs like nurcing care, teachers, sometimes writers. According to some stereotypes, women are more emotional, they find it easy to learn and teach. In order to avoid depression and, unemployment, males and females must have choice what job they want to do and then enter the university where no restrictions must be established.\nIn conclusion, although there are some difficult situation when a person must study the subject they do not want to, I am sure that universities should not limit the number of different gender students because it could lead to huge problems and not balanced labour-market.\n','best'),(33,'ASt_2_2','Nowadays, some groups of people consider that higher school should form study groups for different subjects consisted of the same number of male and female students.\n	There are many points of view for this question and all of them, to any mind, are meaningful. Basically, all the viewpoints are built on the hypothesils of advantage and disadvantage of inequal number of students of both sex. For this I would highlight a number of reasons. First of all, there are some of researches happened in Stanford`s laboratory of social problems which have shown that group gives a higher results of studying when there is inequal number of students of both sex. Afterwards, having already managerial experience, I can confidently say that  a work group brings higher result while there is a sex disbalance. However, the whole raw of arguments may contradict my viewpoint. So, somebody can claim that the whole psychological climate in sex balanced groups is warmer hence the relationships between members are stronger, so the work made by such a group will be more efficient. One more reason to contradict mu position is to say a couple words about loyality. In groups with equal number this parameter is much higher and significantly influences on the situation in the group.\n	In conclusion, I consider that universities should not accept the same number of males and females in every subject. In my opininon, this step would decrease the whole efficiency of study process.   \n','best'),(34,'ASt_21_2','Studies conducted recently show that individual qualities, which we were born with, play a major role in our life can not affect it a lot. The idea is that our developement depends much more on own inilide characteristics than on own life experience.\nThis thought was also a basis for some of Zigmund Fried*s ideas, such as a statement that a human is a wolf for another human. He also argued that humans are aggressive species and that villence is a predetorminer part of our nature. Parallel can be drown between the research recent and the thought of the philosopher. I do indeed belive that the qualities we were born with affect own personality, however process of development must be based on the thongs we encounter during own life.\nI sleek to the opinion of Jean-Paul Surtre and this ideas about existenuanneleum , which are absolutely opposite to the ones, introduced by Zigmund Freid. This french philosopher made up theory , according to wich people*s characters are made by the society , They were brought up in. In his ideas, there is no obstade for people to change their individual ever when they are out of their teenage years. To me this seems more understandable, as there can be really some life-changing experience encountered and this can happen of any stage of life.\nAs it seems to me, both factors infnenu who we got to become, because everyone in diffenr, even if the persons, which we coupou happened to up, children, who are pretty similar in their personalities may grow up completely different people, because of what they may encounter.\n','best'),(35,'ASt_34_2','The qualities of character which we have from the beginning of our life are sometimes considered to be the most important ones. However, some people think that skills that we get through our existence have a stronger influence on our behaviour.\nPersonally, I believe that out life is changing day by day under the influence of new experiences. For instance, we can not only learn something unknown but also understand what mistakes we made in our past life. Moreover, some special features of our character appear exactly when we gain new knowledge and have completely different experience. These characteristics can be connected to the previous ones which we show in the first years of life after our birth but their whole inner content will be another.\nOn the other hand, some researchers provides us information that the personality of each man depends on those qualities of the character we are born with. Firstly, they are sure that process of personal development is controlled by those characteristics and they give us our special way of behaviour. As a consecuence, all of our new experiences are influenced by those striking features from the very beginning. Secondly, these people believe that fact that our mind consists not only from the physiology things from the moment of out birth but also some mental and cognitive activity.\nAll things considered, we can deny that our personality depends on all types of characteristics: both we are born with and we get through having the new experience and gaining knowledge. In my opinion, there is no doubt that the second ones have a stronger influence on out daily life and self-development because every person is changeable and has a tendency to improve himself.\n','best'),(36,'13_2','Environment pollution and global warming are one of the global problems we are facing today. As aircrafts are contributing to them, there is a suggestion that there should be a reduction of business and leisure air travelling. I totally disagree with that due a couple of reasons.\nFirst of all, we should consider that air travel is the only way to get to distant places within a short period of time. Without it we won’t be able to get to, for example, Australia from Europe without spending weeks to do that. People will become nearly locked in their countries or even cities, if we are speaking about such large countries as Russia. The price on the small amount of tickets that will still be on the market will be too high and nearly noone will be able to afford them. As a result, we won’t travel that far, won’t discover our beautiful planet. As for businessmen, they will loose an ability to make international business as they used to, which will affect the global economy. Also, there are countries, which demand on tourists, but with reduced air travelling they won’t get their baxes, which will affect the level of life there.\nSecondly, it’s important to remember that a great amount of pollution is caused by, for instance, cars and there are known ways to solve this problem. We can develop the sphere of electric vehicles, which have the same functionality as the petrol ones. but do not harm the environment. However, nowadays it’s impossible to find a substitute to airplanes, but it doesn’t mean that we should not use them.\nTo sum up, I don’t find it crutial to reduce the amount of travelling by air, as it will bring considerably bad consequences. We’d better take care of air environment by changing things that pollute it rather then banning or reducing them.\n','best'),(37,'28_2','Although the problem of air transportation is relatively recent, it has already become one of the most canvassing topics in the modern in the modern society and the subject of the heated debate. My strong concern is that new regulations should be passed by authorities so as to out down on the amount of nonessential flights.\nTo begin with, the fact that emissions from the aircrafts are extremely harmful for the environment is glaringly obvious. With no restrictions on the number of flights, many of which are rather a means of amusement, than a vital necessity, we might soon face an ecological crisis and end up with no shelter for the following generations. Furthermore, the governments should understand that no ‘green’ movement can be an obstacle for those, who do not pay attention to te environmental issues, therefore a law should be passed to stop this. Besides, with a fully implemented system of air travel restrictions and penalties, it would be easier to come up with long-term state programmes for preserving the natural habitat to all it’s inhabitants and citizens.\nHowever, there are people, who disapprove of such an initiative, claiming that the state is trying to set limits to their rights and freedoms. There might be some truth in that still, I believe that everyone should be in charge for the global environmental problems, such as changes in the ozone layer and greenhouse effect, resulting in global warming. With regard to rights’ limitations we should take into account the fact that our rights and freedoms end where the rights of other person start.\nDrawing up a conclusion to my thoughts, I would like to stress, that only global efforts of all the people of Earth can open new vista in the face of today’s harsh ecological circumstances, and it is up to the authorities throughout the globe to be trendsetters. Nothing should be taken for granted and the future of our planet is not an exception.\n','best'),(38,'2_2','Social media usage is on the rise and no are debates as to what its main purpose is, with some claiming it is information and knowledge sharing, and others refuting that sites such as Facebook and VK exist purely for entertainment. In this essay I will examine both of these views followed by a reasoned conclusion.\nMore and more people use social media websites for educational purposes and thus regard this as the main aim of these sites. Indeed, not only many institutions and organisations have their own pages on social media site with sufficiently full and up-to-date information, but also it can be used by ordinary people as vital news outlet. For instance, during so-called «Black-out», the series of resonant race-related protests aimed at combating unjust police brutality in the USA, social media such as Twitter and Facebook were often the only source of information for people not directly involved in the protests, as the conventional media relayed scarce or incorrect reports.\nThere is undoubtedly another facet to social media, namely its entertainment value. A wide variety of games, quizes, musical playlists, visual collages etc. can be found on VK or FB any given day. It is because of this facet that many argue that social media should simply entertain, because it is a rare safe haven among a sea of negative information coming from elsewhere. Admittedly, you need only turn on your TV to see a report on a war or other tragedy within a few minutes.\nHowever, it is agreed that social media’s main purpose is after all, relaying information and knowledge. Entertainment value can still be found widely, one could say that the entire modern culture is built on entertainment. With this in mind, social media is unique in that it posseses a rare accessibility quality, usable for the widest array of people and is thus too important to neglect when discussing its information value.\nIn conclusion, there is no consensus generally as to the main purpose of social media, but it is agreed that sharing information is more vital than mere entertainment as it possesses some unique qualities in this capacity such as accessibility.\n','best'),(39,'10_1','The line graph illustrates how changes the amount of profits of Apple, Samsung, Blackberry and HTC for the period of five years. \nOver the period from 2010 to 2015, Apple`s figure had upward trend, when Blackberry and HTC had downward trend and Samsung rised to its highest point and then decreased to the start level. \nIt is clear that the highest percentage of share at 40% in the year 2010 had Apple. Samsung`s and Blackberry`s figures were about 20% which was a half lower than Apple`s, and the lowest percentage had HTC that was around 10%. In 2011, the figures of HTC, Samsung and Blackberry were the same at 20%, while Apple`s percentage of share rose to 60% and 78% in 2012. In 2013, the percentage of profit in Apple decreased to 60%, when Samsung`s figure reached a peak at about 40%. In the same year Blackberry`s and HTC`s profit continued to fell. \nIn 2015, Apple reached its highest point at more than 90%, while Samsung`s figures dropped to about 15% and HTS`s and Blackberry`s to less than 10%.\n','aver'),(40,'11_1','The line graph illustrates changes in the proposition share of global smartphone incomes between 2010 and 2015.\nIt is clear that total earnings of Apple rose dramatically over a 5-years period. By contrast, profits of HTC and Blackberry fell during this years and Samsung income were the same level in 2015 as in 2010.\nIn 2010, profit of Apple were approximately 40% share. Whereas income of HTC were about 10% and incomes of Samsung and Blackberry were 15% and 20% respectively. However, in the year 2013, Samsung hit a peak it’s profit, which rose by 28%. HTC and Blackberry had a slight decrease and both had 8% in 2013. Apple totally had upward trend: company’s profit was 70% in 2012, but during the next year it fell by 10%\nIn 2015, Apple incomes significantly increase to 91% share. Profits of 3 other companies gradually drop to 2015. Samsung’s profit were the same with their profit in 2010 (about 15%). Blackberry and HTC both has equal earnings in 2015, it was about 5% share for each company.\n','aver'),(41,'14_1','On this chart there is a bar diagram, which shows changes in number of children didn’t have access to primary school between 2000 and 2012 years in different regions.\nIn 2000 the biggest number of uneducated children was in Africa. It was counted by 43,7 millions children. In 2012 the number of uneducated children had gone down to 32,7 millions. The second place in number of uneducated children in 2000 year took South Asia with 32,7 millions. But in 2012 it dramatically gone down to 9,9 millions. And nowadays it is the smallest number in the world between realized on this chart. Rest of World’s number in 2000 year is 23,3 millions. And this number fell down to 15,3 millions to 2012.\nThe gender in all this regions is practically same. More girls than boys are not educated everywhere, except of South Asia and Rest of the World in 2012. The most dramatical situation in South Asia in 2000. There girls were counted by 21,6 and boys by 11,1. But the situation changed to 2012.\n','aver'),(42,'15_1','The graph represents the amount of boys and girls during the period from 2000 to 2012 in different regions who were not able to access the primary school.\nThe overall trend is the significant decreasing in number of children from all over the world without a primary education at school. Another important feature is that in most cases (exept for South Asia and Rest of World in 2012) more girls than boys could not enter primary school.\nAccording to the chart the greatest number of children without access to primary education was in Africa in 2000 year (more than 43 millions). The least number of such children was shown in South Asia in the year 2012. The most significant decline was in South Asia from 2000 to 2012 the number of girls without access to primary school became about 4 times less while the quantity of boys lowered from 11.1 millions to 5.1 millions during the same period.\n','aver'),(43,'16_1','We are given a bar chart which provides us with information about the changes in the amount of children who have not an opportunity to be educated in primary school in different regions such as Africa, South Asia and the rest of the world. The data is divided in two groups: the number of children in 2000 and 2012.\nFirst of all, the main feature is that the amount of boys and girls without primary school educations decreased in all regions between 2000 and 2012. The best decrease was registrated in South Asia from 32,7 millions children to 9,9 millions. Another trend is that in 2000 the number of boys was bigger than the number of girls whereas in 2012 in all parts of the world except for Africa this trend was different. It was still more uneducated children in Africa in 2012 than in South Asia and the rest of the world.\nTo sum up, this bar chart shows positive statistics since the number of primary school students rised dramatically.\n','aver'),(44,'18_1','The line graph illustrates the difference in the percentage share of global smartphone profits over the period of six years from 2010 to 2015.\nOverall, Apple had much higher profits than other companies during the whole period. Although there was only slight difference between other three companies’ profits at the beginning, Samsung showed a significant rise afterwards.\nAt the start of the period Apple had about 42% of global smartphone profits while this value for other companies was in the range between 9% and 20%. There was a swiftly rise for Apple during 3 years and then the rate slipped back in 2012. Samsung’s profit faced the same scenario but kept increasing in 2012 and hit a peak in 2013. Apple had a slight level off and rose dramatically from 2013 to 2015 while Samsung’s percetage of profits swiftly decreased. Apple had an upward trend during the whole period.\nThere were slight chages in percentages of profits for Blackberry and HTC. Both fluctuated from 2010 to the middle of 2012 and then remained stable.\n','aver'),(45,'19_1','The chart provides the information about the change in the amount of children, who don’t have an access to primary school education in twelve years period by sex and region.\nThe most significant trend is that access to primary education has been improved in all considered regions, moreover, female discrimination in education has been decreased. In addition, Africa still has the biggest number of uneducated children in 2012 as in 2000, about 32,7 million in 2012, which is more than three times bigger than in Asia and twice as big as in Rest of World.  Furthermore, these twelve year have witnessed a great downward trend, especially in Asia, where the quantity of girls without access to primary education has become four times less, and number of boys just about two times less. Due to a considerable fall, South Asia has become a leather in comparison to Africa and the Rest of World in 2012, with approximately 10 million of children without access to primary education.\n','aver'),(46,'1_1','The following chart provides information about the amount of time spent, in general, on sports activity by the English citizens of different age and gender.\nAccording to the chart, men, especially young ones, dedicated more time to sports than women. For example, males in the age of 16-24 do exercises in the course of nearly 300 minutes, while women of the same age hardly could spent more than 100 minutes. However, in some cases the number of active women can be higher than men. As it can be observed, women in the age of 55-64 tend to be a bit more active than representatives of another gender. Another important feature, which is demonstrated by the chart, is that older people showed less activity than younger ones. While male teenagers spent almost 300 minutes on sports, the eldest people did not exercised more than 50 minutes.\nOverall, it can be observed that men in England are more active in doing sports than women, and the younger people spend more time on exercises than the older ones.\n','aver'),(47,'20_1','The diagram illustrates how many kids in different parts of the world did not have an ability to go to school in two time periods: 2000 and 2012. The horisontal axis shows different regions in two years, whereas the vertical axis shows the number of children in millions. \nAt the first glance, it is obvious that in less economically developed regions children are more likely not to get a chance to go to school. As well as that, in all regions in almost both time periods boys had more opportunity to get an education than girls.\nAs wee can see, in 2000 the least developed region according to the data, was in Africa. There was noticed the biggest number of children without access to primary school education. It was 43,7 millions of people. Besides, in 2012 Africa did not lose its position and counted 32,7 millions of children without an education, which was still the biggest number by this time. In 2000 South Asia was on the second position after Africa, but by 2012 it has become the most educated region with the least number of kids, who had never attended school. That number is 9,9 millions.\nAS for the second tendency, in each region almost in each time period boys wer more educated than girls. The biggest difference was noticed in South Asia in 2000, where twice more uneducated girls than boys and that variable was 21,6 millions.\n','aver'),(48,'21_1','The chart provides information about how many children have no access to primary education in different parts of the world in 2012 compaired to 2000. During the twelve year period the number of such children decreased significantly.\nThe main trend is that in both 2000 and 2012 more girls than boys still cannot have primary education exept some specific cases like in South Asia in 2012. The most obvious change has occured in South Asia with a fall form 21,6 millions of girls and 11,1 millions of boys in 2000 to 4,8 and 5,1 millions correspondingly. The most poor in primary education regions are still located in Africa. There were some changes in numbers during the period, but they were much slighter than in South Asia. The number of girls without education reduced from 23,7 to 18,2 millions. Also 5,5 millions more of african boys 2012 could have an opportunity to study than in 2000. In the rest of the world the the number of children who can have education have increased since 2000.\nOverall, the main tendence for the whole mentioned regions is to continue reducing the number of children without access to primary education and providing studies to move boys and girls all over the world.\n','aver'),(49,'22_1','The bar chart below highlights how many children, both girls and boys, from different world regions did not have any potential ability to get basic school education in 2000 and in 2012.\nIt can be noticed that South Asia made the greatest improvement in providing children with education among all other regions. Not only the general number of illiterate children here decreased but also the boys and girls’ proportion significantly changed. Number of children without access to primary education in Africa fell too and that cannot be left without attention.\nAs it can be seen from the bar chart, there was only approximately 10 millions of children without the access to education in 2012 in South Asia in comparison to about 35 millions in 2000 which means that there used to be almost 3,5 more children unable to enter school in 2000 than 2012. According to the graph, there was approximately 4 times more girls without education which is just about 2 times more than boys in 2000 who did not have a right to have education.\nSpeaking about Africa, there was a slight improvement in decreasing the number of children with no access to primary schools: almost 5 millions more girls and just over 5 millions of boys were able to get education in 2012 results: the general number insignificantly decreased while boys and girls shares remained stable.\n','aver'),(50,'23_1','The bar chart illustrates changes in the amount of children without access to primary school education during the period of 13 years (2000-2012) by sex and region. Overall, the main trand is that the number of such boys and girls has declined in all of the world.\nThe most significant fall was in South Asia form approximately other tendention: the level of gender discrimination has declined too. In 2000 the number of girls without primary education was 2 times higher than the number of boys, but in 2012 the proportion became approximately equal.\nIt is clear that the biggest number of children without access to school was in Africa in 2000. It has fallen by 18,2 millions girls and 14,5 millions boys in 2012.\nThe general trand also affected the rest of the world. In proportion the situation quite the same as in Africa, but in absolute numbers it is the fall from 12,8 mill to 7,6 mill girls and from 10,5 mill to 7,7 mill boys.\n','aver'),(51,'24_1','The bar chart presents the perentage of children in different parts of the world who do not have a possibility to get a primary education. The data is separated for girls and boys. It shows the situation in 2000 and 2012.\nOverall, the main trend is the decrease of number of children of both sexes all over the world. But at the same time the speed of these changes is absolutely different.\nAs it could be seen from the data, in South Asia the number of uneducated boys became smaller more than a twice. The chart shows that a percentage of uneducated girls in South Asia in 2012 is equal to one-quarter of percentage of uneducated in 2000 and 2012 is the biggest in total in comparison with other countries. If we consider the situation in Africa, we could remark significant changes too. The decrease is not too sharp as in Asia, but it is still remarkable. The number of children of both sexes became smaller for about 5%.\nIf we speak about the rest of the world, it is obvious that the difference between 2000 and 2012 is about 5% for girls and 3% for boys. To sum up, the bar chart shows significant changes of the number of children in all parts but there is a variety of differencies dependence of region.\n','aver'),(52,'25_1','The provided chart gives us information about dynamics in the number of children who do not have any access to primary school education from 2000 to 2012 year divided by region and gender. \nWithout doubt, Africa has the largest number of children without ability to go to the primary school in both 2000 and 2012 years comparing to the other regions. The most dramatic change have happened in South Asia, where the fall in number of kids was approximately 26 millions: from 2000 to 2012. This dynamic has resulted in the fact that South Asia has less children without chance to have primary school education that in the other regions.\nSpeaking about gender trends, the given statistics shows us that gender proportion is almost the same in every region in both 2000 and 2012 years exept for the 2000 year in South Asia when the number of girls with the lack of access to the primary school education was twice bigger than the number of boys in the same region.\n','aver'),(53,'26_1','The chart illustrates the amount of children, which are do not have an opportunity to get education in primary school from 2000 by gender and areas.\nFrom the first glance, it is clear that Africa took the first place in the amount of children, which cannot be educated in primary schools. The interesting fact, that the propotion of boys and girls is aproximately equal, everywhere, exept South Asia in 2000. The number of girls as twice as bigger than boys (21,6 and 11,1). Moreover, South Asia had the smallest number of uneducated children in 2012. That was only 10 millions.\nOverall, it is crussialy important that the number of children without access to primary education was decreasing per years. However, Africa in 2012 still has the biggest amount, which is equal to number of children in South Asia in 2000. However, the main trend is positive.\n','aver'),(54,'27_1','The chart below provides information about changes in the number of children, that have not got the ability to have the number of children, that have not got the ability to have the primary education from 2000 to 2012 by gender and region.\nThe chart below shows the differences between 3 areas: Africa, South Asia and Rest of World. It is obvious that in general the changes throughout the period are positive: the number of children without acess to primary education was dramatically declined. For instance, in South Asia the number of girls without acess to primary education decreased from 21,6% to 4,8%. At the same time, the number of boys changed from 11,1% to 5,1%. In the Africa changes was not so significant, however, the number of children without access to primary education declined from 43,7% to 32,7%. Besides, in the Rest of World the number of children without access to primary education during the period also changed from 23,3% in 2000 to 15,3% in 2012.\nIn conclusion, the differences between 2000 and 2012 are rather noticable. Although, the problem is not solved yet, the positive changes are very important for children’s education.\n','aver'),(55,'28_1','The chart provides information on the number of offsprings getting no primary education, distinguished by region and gender, in the years 2000-2012.\nThe general trend was clearly downwards, though the ratings varied notably between the regions and genders. The highest mark of the number of children without any primary education available was noticed in Africa with 20 millions of boys and 23,7 millions of girls, respectively, making for an insignificant difference between genders in 2000. The lowest rates of uneducated children were spotted in the “Rest of the World” region, with numbers twice as low as in Africa for the same periods of time. Both regions experienced a steady decrease of, approximately, 10 million adolescents over the period with the total of 33 millions and 15 millions for Africa and Rest of the World respectively. The most striking feature is the dynamics for the South Asia region. The number of children with no access to primary education fell dramatically from 33 to 10 million offsprings by the year 2012, which is an absolute minimum for the data given. Besides, the proportion changed greatly with the girls’ number twice as much as the boys’ in 2000 and almost the equal numbers in 2012.\nAll in all, it can be stated, that rates varied notably, enabling, however, to make out an obvious downward tendency.\n','aver'),(56,'29_1','The present bar chart illustrates the quality of kids which are different sexes and live in different locations without the opportunity to attend primary school and the changes in the situation from the beginning of the twenty first century in twelve years.\nOverall, it is a downward tendency in the number of children without an access to primary school in all the three regions. The greatest rise in the level of access happened in South Asia when approximately twenty three millions of children have got an opportunity to study.\nIn the beginning of the described period a number of boys with the access to primary education was definetely bigger then a number of girls having such access. For example, in South Asia the number of such boys was approximately two times bigger – almost twenty one and a half millions versus almost eleven millions.\nBy the year two thouthand and twelve more children were given an opportunity to get elementary education. They are ten millions of kids in Africa, eight millions – in the rest of the world and the most significant changes happened in South Asia where the gap redused for approximately twenty three millions of children.\n','aver'),(57,'2_1','The provided chart gives data on average time reserved for doing sporting activities by men and women in different age groups in 2012. It can be concluded that time spent doing sports generally decreases with age, and that men tend to spend more time on sports than women, with the only exception being age group of 55-64 where women dedicate slightly more time to sporting activities. The peak of sporting activity is observed in men aged 16-24, at nearly 300 minutes, while the smallest figure is found in women over 75 at only 10 minutes. However, men experience a rapid fall in sporting activity at ages 25-34, when the amount of time that is spent on sports is cut almost in half. On the other hand, the similar trend for women is not associated with such sharp decreases. Overall it can be observed from the chart that women are slightly less active but more consistent in doing sports.\n','aver'),(58,'30_1','The graph illustrates the amount of children who do not have the opportunity, to go to school in a period of time from the year 2000 to 2012 by sex and geographic location.\nThere is a general trend in all given countries including Africa and other states all over the world-girls tend to have less access to primary education than boys. So nearly 45 millions of children could not afford education in 2000 in Africa and more than half of that number is established by girls – 23,7 millions to 20 millions of boys. This proportion is even more in the South Asia in the same year – 21,6 millions girls compared with 11,1 millions of young men. In the rest of the world situation was the same in 2000 – 12,8 millions girls to 10,5 millions boys. The trend began to ruin by 2012. All selected countries changed the politics to gender factor. So, in South Asia and the rest of the world the proportion between uneducated boys and girls became almost the same at that time – 4,8 millions of girls to 5,1 millions boys and 7,6 millions of girls to 7,7 millions of boys. The only exception is Africa – the number of girls who don’t go to school because less but as in the past, boys tend to have more access to the educational programs.\nAll in all, we can see that the amount of uneducated children falls down each year and girls now have nearly the same opportunities for studying as boys do.\n','aver'),(59,'10_2','Today a lot of young families want to be finantialy independent so both parents refer work than to raise their children at home. \nOf course, it happens not because mother and father don’t want to sit with their kids. The main reason is that prices for goods are high so it is necessary for families to have enough money to buy these products. It is obvious that everyone wants to live the full life and not only to get by with. Education of children is also expensive and parents always pay a lot of money for it. What is more, families want to travel on their holidays and go abroad at least once a year. \nIt is clear that this kind of lifestyle causes some problems in fostering the children. Firstly, kids do not enough parents` attention, which can lead to psychological problems in the family because children can think that parents simply don`t love them. Secondly, this makes it hard to foster kids. Children spend a lot of time in, for example, kindergarden and take a wide range of habits from other children. Some children are bad behaviored so they can teach others to do the wrong things. And finally, the less time parents spend with children, the harder becomes for them to communicate with each other. It can cause different raws between parents and their kids. \nTo sum up, parents in modern families spend less and less time with their children but going out to work is the only way to provide family with all necessary goods.\n','aver'),(60,'11_2','In a huge number of today’s families, mother and father go out to work and their children spend time with parents rarely than they did else some decades ago.\nThere are some reasons that cause this problem. First of all, parents want to provide an excellent future for their children. Nowadays it’s difficult to reach something in the life without money. So, parents work a lot to earn a huge sums for children’s needs and children’s future. What is more, some people like their jobs That’s why they prefer go to work instead of spend additional time with their children. In addition, some parents have hard, low-paid job and they work more and more only to provide acceptable. Standard of living for children. Such people simply have no opportunity to spend time with their family.\nIt is easy to find some problems that caused by this reasons. Firstly, children and their parents have no trusting relationships because they don’t spend enough time to gether. Secondly, parents and childrens become strangers to each other. They don’t share problems and joys, they know a little about each other and they cease to be a real family, Finally, when children don’t spend time with their parents they spend it with other people. So, children can get into a bad company and start to smoking drinking or even druging. After it parents can hardly influence on childrens and take them to the right way.\nTo sum up, when parents and their children don’t spend enough time together their family starts to destroy. So, parents should decide what is more important their work and money or their children. If they choose job it can cause a lot of problems in their family.\n','aver'),(61,'12_2','In a modern world most of parents prefer to dedicate their life to career rather than to stay at home and take care of their offsprings. They decide to put kids into a kindergarden or ask grandparents for help. Anyway, this decision do not always benefit the children`s fostering and can raise some essential issues. \nSeveral reasons for such families choice can be suggested. First of all the adults would like to have a high income, therefore they do not want to miss job opportunities if there are some. Secondly such people wish to dain more experience in order to become successful and rich. In this case they will not have to worry about money when they are retired. Finally, some young mothers find it boring to spend all the with babies, nurishing and entertaining them. They decide to make their life brighter and, what is not less important, more independent from their husbends. \nHowever, such choices lead to situations, when children do not spend enough time with their parents, and it causes following problems. As for the first one, kids suffer from lack of attention and control, and it can result in involving them into troubles, such as street fighting, smoking, drinking alcohol or some criminal issues. Secondly, instead of playing having some delightful discussions with parents, children dedicate all the spare time to computer and any other electronic gadgets. These can influence their mental health and even cause some diseases, such as computer addiction. Finally, if all its members lose interest in daily routine of each other and they fall apart. It can end up with cheating on, different types of depression, misunderstanding and maybe even divorces. \nTo sum up the wish if the adults to earn plenty of money is clear and understandable. But they always should remember, that their kids do not appreciate them for dollars and most of times the problems, caused by attention lack, cannot be solved by any finances.\n','aver'),(62,'14_2','Governments all over the world are thinking about reguling air travels to stop air pollution and global warming. People have different opinions on this problem.\nI think that this idea is unnecessary at all. My opinion is that by air travelling people can live everywhere they want and stay in connect with other world. By air anyone can go to other part of the world in 10-15 hours. In the past this way could take much more time.\nAls air travel does not need roads or railways. It need only two airports in place A and place B. This is cheaper to build an airport than many kilometers of road. And also I think that other types of transport is harmful too. And planes helps the world to be more open.\nBut not all people agree with this opinion. Some of them think that planes are very harmful. Planes fly all over the world and over North and South pole. This is one of the ideas why global warming is so big. Also planes pollute air and it is very bad too.\nIn conclusion I can say that all types os modern transprort are harmful. But planes have many good qualities. So the idea of reguling air transport is not very useful.\n','aver'),(63,'15_2','Nowadays air pollution, global warming and other environmental problems are very urgent. One of the reasons of them is a rising amount of air travelling for business and leisure activities. Some people believe that government should decrease air flights by introducing strict laws, while others are not agree with this idea.\nAs for me, I strongly disagree with this idea. First of all, according to the statistic much more poisonous gas and exhaust fumes are produced by cars, due to this fact it will be more useful to introduce more laws for reducing amount of cars which is constantly rising nowadays.\nMoreover, reducing the amount of air flights will cause some kind of economic crises for air flight companies and influence the number of people who will start use their private transport such as cars, and using of trains and ferries is also will increase. However, this kinds of transport produce more waste in the atmosphere. As a result, this laws for reducing air travel will not be effective and useful for the environment and will lead to crisis.\nHowever, decreasing of number air travel will lead to some positive effects as more strict rules for technical equipment of planes, as a result, air flights will become not only more nature friendly, but also safier for passengers.\nIn conclusion, I must say that reducing the amount of air travel by introducing laws be government is a quite useless idea which will not help to decrease air pollution or global warming significantly, but will lead to serious economic problems all over the world.\n','aver'),(64,'16_2','Nowadays the humanity try to solve more and more serious problems. One of them is a rapid growth of air pollution and global warming caused by increased number of travelling by air. There is a belief that the amount of air travel should be controlled and decreased by governments. As far as I concerned, I consider this idea to be irrelevant in today’s world for the following reasons.\nTo begin with, it is a very difficult to decide which air travels are necessary and which are not. It is almost impossible to create such organization or a law that will explain why this or that travel must be canceled. Introduction of this laws will probably cause negative moods in the socity. We cannot abandon all the leisure travels but if they are reduced everyone must have the same rights.\nWhat is more, most of the business trips must be done as soon as possible. It usually has a great impact on peoples’ life conditions since a lot of projects and contracts are connected with humans’ difficult to mind of how a persons from the US and Japan for example will do their business without travelling between their countries.\nBesides, from my point of view, problems caused by air travel must be dealt with. But it is up to the government to find a solution not in decreasing the number of flights but in improving technologies which reduce the consequences caused by a plane.\nIn conclusion, the problems of polluting the air and global warming still exist. Nevertheless, everyday air travelling strongly affects the humanity and the decision to decrease the amount of it will probably solve environmental problems but will cause more social issues.\n','aver'),(65,'17_2','It is believed by some that people should travel using plane only due to emergency cases. Otherwise, we should not be allowed to us planes as they contaminate our environment. I completely disagree with this statement. In my opinion, planes is one of the greatest inventions in the history and we should take the best out of it.\nFirst of all, planes is fastest way to travel to other countries. Nowadays, people just cannot afford themselves spending days and weeks on travelling by cars or ships. It is too long and they are too busy to waste time on such long journeys. What is more, with globalization, the world is changing very quickly and innovations in one country have immediate effects on others. This is why business trips should be fast, so that people had the chance to adapt to changes properly.\nHowever, some people are certain that air travels have disasterous effect on environment condition. Nobody can argue that, but in fact, cars, ships and other means of transport do as much harm to nature as planes. If we compare a plane for 150 passengers and 150 personal cars, it is clear that the first option is better. Another argument against planes is a huge possibility of air crash. However, statistics proves that plane is the safest kind of transport.\nTo summarize, I would like to say that although a huge plane seems the biggest threat to our environment, in reality, it is not. Furthermore, air travel is the safest and fastes way to reach the destination.\n','aver'),(66,'18_2','Nowadays it is common for both parents to have a full-time job. Hence, children don’t receive as much attention as they used before.\nThere are some reasons why parents choose work instead of spending time with their child. First of all, if both parents have a job, it significantly increases the budget of the family. It allows them to spend more money on vital things for children such as good education. Secondly, women usually are eager to get back to their jobs and climbing career ladder after spending early years of child at home. In such cases parents usually leave their child to close relatives or to a private nanny. There is also an option when a child can stay in school or kinder garden until the evening.\nHowever, leaving children and lowering the attention received by them from parents can lead to some significant problems, especially if it happens during early childhood. To start with, if the child is used to be very close to parents, such sudden lack of their attention can cause psycological problems. It is a hard chellange for a child to start spending some time without parents nearby. In addition, in case when parents don’t talk to their children often and are not interested in their concerns, children might build a strong opinion that parents don’t love them and don’t care about them. It can lead not only to broken relationship between parents and children in future but to many childhood fears and self-inconfidence as well.\nIn conclusion, it is an often situation when both parents go out to work. Sometimes they just don’t have a choice in order to provide the family with all needed goods and facilities. Although it is a normal situation, it should be done very carefully as such actions of parents can affect children roughly.\n','aver'),(67,'19_2','National governments nowadays are seriously concerned about air travelling due to high levels of air pollution and effect called global warming, thatswhy they have to decide whether they should invent laws to decrease the number of flights or find another solvation.\nOn one hand, great amount of air travel is damaging nature every day, not only because they consume huge number of resources, such as fuel, oil, but also because of poisoned gas and waist thrown into the air. Moreover, some people say that air travel in many cases is unnecessary, because we have lots of other ways of transport. In addition, this type of travel cause serious and dangerous long-term outcomes, especially global warming, hence contemporary governments have to take measures to prevent future disasters and destruction of the nature.\nOn the other hand, introducing new laws to reduce the usage of air transport significantly seem to be too strict and not adequate to the situation, because it is still the fastest and the most comfortable way of moving from one place to another. Consequently, we have to focus not only on trying to decrease number of flights, using laws, but also on saving nature in general, taking actions against every source of pollution. Moreover, there are lots of alternative ways in solving problem of air pollution, except making laws: for example, finding new efficient sources of energy or improving air cleaning systems, or even making engines more efficient and less polluting. \nIn conclusion, I would like to say that the best solution is to improve effectiveness of engines and to make the amount of gas thrown into the atmosphere fall down, until we find a new way of transportation, which would be faster, more comfortable and less damaging to our planet. To add, I think that appropriate option is to find a way to improve present transport, but not to get rid of it.\n','aver'),(68,'1_2','There are different point of views on what the main functions of social networks are. While some says the social media should provide various types of information and improve knowledge of people in different spheres, the opinion that websites such as Facebook or Vkontakte were created only for entertainment also exists. I would rather agree with the first point of view.\nFirst of all, social networks are good tools for education. They are open to everyone which means people can share their own knowledge with others, download some useful books and materials access to which is usually limited, discuss problems and find their solutions together. Interacting with other people, many of whom have a high level of intellect and a considerable amount of life experience, can give a person an opportunity to improve his own knowledge. Besides, exchange of opinions on the certain matter during discussions in social networks can help people to find mistakes in their theories and develop it.\nAnother important feature which should be taken into account is that Facebook and Vkontakte usually provide much more information about recent events than official news websites and, thus, are very useful those who want to find out more details.\nOf course, it must not be forgotten that for most people social networks are only entertainment resources. Many of ordinary citizens claim that they discussed enough serious matters at work, and at home, sitting in front of the computer, they just want to relax. Nobody would denies that social networks provide a great range of games, movies and other types of entertainment. Still, I would argue that the main purpose of Facebook and Vkontakte is providing information as it is necessary for everyone to know about what is happening in the world.\nHaving said that, although. entertainment and sharing of knowledge are both very important functions of social media, the last one seems to be more important for modern people.\n','aver'),(69,'20_2','Evidence seems to suggest that the dispute about the effectiveness and environmental usefullness of the air travelling is extremely merit. There are plenty of people and authorities who are absolutely sure that modern society can easily exist without travelling by plane. Moreover, reducing the air travelling will lead to saving the environment. I absolutely do not agree with that the statement and now I am going to consider my point of view.\nFirstly, air travelling is the fastest kind of transport by present day. Great number of people use it every day to get to the destination, which may be extremely far from their homes. What is more, people us planes not only for their targets, a lot of business trips happen each day. And can you imagine the situation, when have to have a deal on millions of dollars US, and the should spend some days or maybe weeks to meet with their partners. As a result, the economy of many countries can be damaged greatly as well.\nSecondly, if governments reduce the number of air travels, there is no doubt that soon they will find an increase in using other kinds of transport, which are not less environmentally harmful as planes, like cars, trains, buses and so on. It is obvious that all these transport can be as damaging for the nature, as planes do, or maybe ever more.\nAnd finally, governments risk to meet with dissatisfied people, as the reducing the flights means the increasing costs on other transport and disability of people to get to place in the latest way.\nTo sum up, I would like to say that surely air travelling is dangerous for the nature and soon it will appear in great problems for the mankind. However, we should not recognize that as the only one factor and concentrate on what is, obviously, supposed to be the best and most modern way of travelling on long distances.\n','aver'),(70,'21_2','Some people claim that travelling by air leads to environmental problems, so governments should prohibit such an enormous amount of flights. It is a kind of very controversial question, that is why I can only partly agree with this statement.\nFirst of all, taking care of environmental is important, but it should not harm the process of maintaining economical stability and communication all over the world. Air travel provides lots of opportunities for business and helps people to stay in touch with other parts of the world. By reducing a huge amount of flights some really serious problems with transportation may occure. Also this fact can cause the loss of governmental budgets and citizens’ unsatisfaction. Such economical unstability and problems with transportation of people and goods an lead to crisis and serious lack of money.\nFurthermore, planes contribute to less air pollution than, for instance, cars and other vechicles. In order to save less poisoned air governments have to create some laws to make people use private cars less instead of making laws to reduce the number of air transportations. Also modern planes become more and more environment-friendly, so using them in nearest future would not be as harmful as it seems.\nTo sum up, I only partly agree that planes contribute to great air pollution. Also I strongly believe that governments should not introduce laws to reduce air travelling.\n','aver'),(71,'22_2','Global warming and air pollution by technological progress in transport engineering form a problem that is one of the most widely discussed all around the world. This issue affects every single one person and therefore cannot be left without attention. Some people believe that governments have to minimize the amount air travel in order to save ecology while I believe that it is not necessary and, moreover, not enough to protect our planet: from dangerous pollution.\nFirstly, aircrafts are simply not the greatest danger our planet ecology face. There are around 50000 flight registered every day which is few times less than the number of car trips completed. It leads to a thought that it would be smarter to manage and regulate car usage which woutd minimize pollution rather than introducing laws to reduce air traffic.\nSecondly, technological innovations have to be taken into consideration too. World’s most famous enterprises that produce airplanes spend millions of dollars in order to achieve higher results in eco-friendly engineering. This means that aircrafts, used in transporting people, produce less air pollution than the ones that were used years ago and all measures required are taken in order to follow international standarts of ecological production aimed to safe our planet.\nTo conclude, governments have to concentrate, on same more serious sources of global warming and air pollution rather than just sticking to one insignificant source and leaving unnoticed most dangerous ones.\n','aver'),(72,'23_2','I could not agree more that air travel is one of the cause of global warming and air pollution because of its greenhouse gases. However, I think that government regulation of this public transport hits the liberty. Let us analyze everything in detail.\nFirst of all, there are basic human rights which say that any travel should be free, despite the purposes. It means that authoritys could not order which travel is unnecessary. For example, statistics shows that about 50% of people all over the world have very hard work, so they need continious rest. In this case it is illegal to ban rases to resorts.\nIn addition, I believe that the majority of modern countries are democratic. Consequently, the government has not power to introduce such radical laws without public discussions. For instance, in Australia the authorityes got an idea to change the national flag in 2009. But many cityzens were agains and after voting it was saved the old flag.\nOn the other hand, my opponents argue that it is very dangerous to the natural environment to allow huge amount of air travel. I can not agree with that at all. I believe that the main cause of air pollution is greenhouse gases from our cars. Airplane is very expensive machine, so the amount of them is quite little in the world. However, there are thousands and thousans cars in our streets.\nAll things considered, I strongly believe that governments shouldn’t introduce laws to reduce the amount of air travel.\n','aver'),(73,'24_2','Nowadays people travel by plane every day but this process lead to pollution of the atmosphere. Some people are sure that it is necessary to limit the number of fights using such instrument as laws. I disagree this point of view that laws about reducing the number of air travelers could help us save the nature and particulary the fresh air.\nFirst, we should not forget that planes are not the only transport which put dangerous gases in the atmosphere. There are a lot of cars, buses, etc. using oil and producing CO2. OF course, someone could argue that it is too difficult to decrease the number of cars on roads, because they are so necessary in our everyday life and we could not imagine our life without it. However, I strongly believe, that we could find a new solution as electronic cars or any other type of ecological cars.\nThe other reason to not limit air travel for business and leisure is the support of economics. Air flights nowadays are integrated in multiple business processes and the reducing of the amount of air travel could cause unexpected negative effect. Some people support the idea of replacing air travel by sea travel and they think this action will have a good influence on atmosphere. Despite the fact of decrease of air pollution, the new type of impact on nature will appear. This impact called sea pollution will affect on sea animals and humans living near the cost.\nMoreover, governments will face with difficulties with creations of this new law as it is quite problematic to decide which category of population could fly and which could not. Scientists may remark that there are many specialists in laws, statistics and logistics who’s work is to solve such problems. But I suppose, that population reaction will be unpredictable too.\nIn conclusion, I  would say that flights limit is not the better way to reduce air pollution and make our atmosphere fresher. I think there are many alternative steps to avoid increasing of negative effect of human activities in nature. People should respect the nature but it does not mean they should not use airplanes.\n','aver'),(74,'25_2','It is a well known fact that in our modern word ecology is one of the most important global issues. And one of the most dangerous problems existing are undoubtedly air pollution and global warming which are the effects of many world processes, for example, it has been proved that air travel would lead to those dramatic problems. There is a widely spread opinion that government structures should control the number of air travel by the power of law, but from my personal point of view it is not the most effective solution to this problem.\nFirst of all, although it is true that in our time we have a huge amount of unnecessary air travel incidents, it could be very difficult to establish an international law that will control the number of flights. Most of the flights are happening when people want to visit other countries and because of that it is important to make almost every country in the world to agree with such politics, which is almost impossible. \nSecondly, this solution to the global warming and air pollution problem caused by air travel is not the only one. Governments could reduce air pollution by investing in science in order to make more ecological fuels. This method could solve the problem without difficulties with law in different countries.\nTo conclude, I want to say that even though making the law sounds like an incredible solution to solving the global problems but it is so just in theory. In practice there are more effective and easy ways to handle that issue.\n','aver'),(75,'26_2','Nowadays, air travel can be the cause of air pollution and global warming, that is why goverments could create laws, which will reduce the amount of air travel.\nI am agree with the previous statement for several reasons. First of all, enviremental problems becoming more and more significant every year. Goverment should do everything and make all necessary measures to safe our planet. There are a lot of different types of transport, which can replace the airplanes.\nMoreover, there is no doubt that airplane is one of the fastest way of travelling, but at the same time it is one of most dangerous. I believe, that the majority of people will prefer the train instead the plane, if goverment explain the danger of airplanes. For instance, goverment can introduce the law to reduce the amount of air travel, but also, make modern trains, which will be fast and more comfortable.\nFinaly, in my opinion, not only planes is the cause of air pollution. Different factories, which make airplanes, also «guilty» in pollution of air. If the number of planes will decreased, many factories could be closed. It is also can help.\nIn conclusion, I would like to say, that this law is a necessary measure, which could help to avoid some enviremental problems such as global warming and air pollution.\n','aver'),(76,'27_2','Nowadays a lot of people argue about air travel. Some of them are sure that the amount of air travel should be reduced as it caused air pollution and global warming. However, others are claim that is not the most crucial problem.\nI support the first point if view for a variety of reasons. First of all, air pollution, which is caused by the enormous amount of air travel, is the reason of global warming. A lot of countries are suffering from the consequences of it, trying to find the way to stop it. The problem is that the one country cannot deal with global warming alone. The all world should pay attention on how air travel is harmful for our planet. Moreover, people should think about the alternative ways of travel, which can be more harmless. Besides, scientists can create less harmful and polluted types of planes.\nHowever, other people are sure that air travel is the least way of travelling. They claim that air travel is the fastest and the safest. There are more car accidents per year than the plane crashes. Also, they are strongly confident that it will be very expensive to create a new type off plane. They are sure that it is better to spend money on more important problems, like hunger and economical crisis.\nI do not agree with this point of view because we cannot safe money on essential problems like global warming. People should try to help poorer countries to survive. I agree that the hunger is also one of the most crucial problems. But I am sure that it does not mean that people should forget about the others.\nIn conclusion, I am strongly confident that people should be very careful with the global problems as they influence not only our planet, but also the mankid.\n','aver'),(77,'29_2','Air travel has been proven to contribute greatly to air pollution and global warming. As a lot of air travel is unnecessary, governments should introduce laws to reduce the amount of air travel for business and leisure. To what extent do you agree or disagree?\nIt has already been concluded by scientists that aircraft produces too much CO2 emissions and destroys our environment. Some people would advice government to regulate the number of most popular flights to prevent the climate disaster. Others consider this idea useless and impossible and so do I.\nFirst of all, after reducing the amount of business and touristic air travel any government will not be able to provide some transport instead and save the level of convinience. People will not be ready to sacrifice their time and comfort and, for example, travel 9 hours by train instead of flying for 1,5 hours.\nSecondly, such suggestion would be a direct affact on the people’s freedom and liberty. In modern society everyone has a right to move and travel to any place by any legal transport.\nThirdly, the regulation activities in the sphere of air travelling will lead to the decline in the level of economy. A lot of people working in the air companies and touristic field will loose their jobs because of the decrease in the demand.\nAll the things considered, I strongly believe that the reduce in the amount of some air travel will have more negative impact on people than positive impact on the environment. That is why I would suggest to support the science to solve the problem of pollution inventing new ecological technologies.\n','aver'),(78,'30_2','Shipping cargo and the passengers by airplanes leads to polluting the atmosphere and the raise of temperature all over the world, so must be taken laws for the reducing the number of air travel for business and tourism activities. In this essay both arguments will be introduced on this topic.\nSome say that we should reduce the number of the flights to save our planet and ecology. Carbon dioxide which is thrown in the atmosphere by planes causes global warming and ice melting and planes produce most of it, so less planes means less pollution. However, cars produce much more CO’s in total but nobody talks about banning them.\nOthers have strong belief that rulling air travel industry by government will cause a decline in a number of companies connected with that field of economy. They claim that for same undeveloped countries tourism is the only way of earning the money as for the businessman as for the government budget, so by these eco-laws the economics will crush in logistics, tourism and other sectors, but they forget  that our planet’s resources are not timeless and now we face the problem of the existing of our environment which is more important than the economy.\nAs for me, I tend to believe that the best way to solve this problem is to find alternative sources of energy and to make eco-friendly techologies. For example, electric planes which wouldn’t harm the planet.\nAll in all, the question of government rulling in air travelling is not the easiest one, so each country should decide for itself what is better, but personally I think that developing safe technologies is the best solution, but until it becomes common to humanity. We mustn’t regulate the number of flights and harm economics.\n','aver'),(79,'VKo_8_1','The bar chart illustrates post-school qualifications in Australia and the proportion of men and women held them in 1999.\nTo begin with, we can see that the precentage of men taking the skilled vocational diploma is bigger than the women*s one. However, the number of women who have an undergraduate diploma is bigger.\nWe can also see that the precentages of men and women with Bachelor*s degree (?) similar.\nThe number of men with Postgraduate diploma is twice bigger than the number of women. We can find that the difference between precentages of men and women with Master*s degree is 20%.\nTo sum it up, I want to note that according to this chart the precentage of men with skilled vocational diploma, postgraduate diploma and Master*s degree is bigger than women precentage.\n','worst'),(80,'VKo_19_1','On the bar chart we can see the different stages of post-school qualification in Australia and the proportion of both sex who held them in 1999.\nWe can see a rise trend of male qualification in position of skilled vocational diplome, to pay attention, it was almost 90% and high amount of postgraduate diploma men - the percentage was 70. The highest female data is over 70% persent in level of undergraduate diploma.\nThe general trend was that men were more succesful in three stages and female qualification was higher only in two stage, for example, in bachelor*s degree.\nTo sum up, the post-school qualification of men are not much, but higher than women*s.\n','worst'),(81,'VKo_22_1','The first tendancy, which one can notice on chart, is the quantity of males, with skilled vocational diploma 9 times higher than females with such kind of diploma. It*s the highest difference which concerns post-school qualifications in Australia. Another differences are less noticeble. For example, there are 60% males with degree of master and 40% females with this one, so the gap is only 20%. If we speak about men*s dominating they lead in the category of postgraduate diploma. The last parts of chart, bachelor*s degree and undergraduate diploma, are more popular among women. While skilled vocation diploma is considered as less preferable way among them. In total one can say that the quantity of people, who get post-school education, are the same in comparasion with Europe.\n','worst'),(82,'ZEv_28_1','The two graphs provide the information of travelling to and from the UK over a 20-year period, from 1979 to 1999, and illustrate what countries had the most popularity among UK visitors in 1999.\n\nFrom the first graph it can be seen that the number of overseas residents was about 10 millions and approximately 12.5 millions of the UK residents strongly jumped to 30 millions and continue grow up reaching about 53 millions in 1999. At the same time the number of visits to the UK by overseas residents start to increase and got to about 28 millions in 1999. From the second graph we can see most popular countries visited by UK residents in 1999. On the first place is France. The percentage of UK visitors reached about 11 millions in 1999. In contrast, the most unpopular country among British is Turkey (approximately 2.5 millions of UK tourists). On the second place was Spain (about 9.5 millions). Among disliked countries also were Greece and the USA. \n\nTo sum up, during the latest 15 years of 20th century tourism wand travelling to and from the UK became develop intensively. But British people are more interested in travelling than residents of other countries.\n','worst'),(83,'EEm_18_1','The graph represents to us the proportion of the population of people which aged 65 years over between 1940 and 2040 in Japan, Sweden and USA.\n\nWe can say that in Japan between 1940 and 2030 less people lived to aged 65. But since 2030 this situation is change. Population of Japan live more longer. In 2040 27% of population live to 65 years. In Sweden population which aged 65 is 7. The graph of proportion population hesitat.\n\nIn USA in 1940 proportion of population aged 65 and over was the highest (9%) between Japan and Sweden. The graph hesitate and to 2040 year is 24%.\n\nTo sum up, in this graph we can see that in 2040 the first places among three countries is Japan. Population of this country live longer. The second place is Sweden - 25% of population lived to aged 65 and over. The USA to less their position, and now is in the third place; but in 1940 was the first.\n','worst'),(84,'EEm_28_1','This graph illustrates the number of the population aged 65 and over between 1940 and 2040 in Japan, Sweden and USA.\n\nFirst of all, there are three main trends and figures connecting with all three countries changed. In 1940, the percent of older population was nearly 10%, in contrast in Japan it was only 5%. Next, in 2000, there was nearly 15% of the population aged 65 and over in USA, while in Japan it was only nearly 5%, but after this the graph rise dramatily, and experts say that in 2040 the population of older people in Japan would be nearly 27%. On the other hand, experts predicted that in 2040 in USA would be only 22% population aged 65 and over.\n\nNext, in Sweden in 1940 there are only 7% of older people, but when the line rise and expert say that in 2040 there will be the 26% of the population aged 65 and over.\n\nTalking at all, from 1940 to 2040 Japan and USA changed the positions. Clearly, that persentage of the population aged 65 and over rise in all of three countries.\n','worst'),(85,'DZu_40_1','This table shows the Underground Railway systems including six cities. The first metro was founded in London in the 1863. It’s the first metro in the world. Los Angeles is the youngest one with its metro founded in 2001. Only 45 millions of people use Kyoto’s metro every year, because its small Japanese town. On the other hand is Tokyo also situated in Japan but it is big megapolise with the 1927 millions of people. It is the highest score! The longest railway is situated in London. Its about 394 kilometres of route.\nThe next one is Paris with 199 kilometres long. Third place has Tokyo with 155 kilometres. And the last one is Kyoto with only 11 kilometres. Finally, the biggest railway is in London. The oldest one is in London also. The highest people traffic has Tokyos railway with thousands of people every year.\n','worst'),(86,'KKo_18_1','As it is shown on a chart, number of calls by local fixed line has increased during the period from 1995 to 1999, and then it decreased from 2000 to 2002 to the level of 1995, less more than a 70 billions. But till 2002 this type was the main. The international calls have only increased during all the period of the chart. At 2002 number of this calls rised less than twice. In the chart this type always has a second place in numbers of calls. The number of mobile calls has increased about 10 times during the period of chart. In 2002 this type of calls reached the level of international calls in 1996, 40 billions. But in the end of period of chart it is still lower than other types of calls.\n','worst'),(87,'LPo_8_1','The graph shows information about proportions of population aged 65 and over for three countries: Japan, Sweden and the USA. The graph shows date from 1940 to 2040. Over all proportion is growing up for the and of the periods.\nThere is trend for hard raising in Japan and in the USA. We can see that bouth line up fom 7-9% to 15% 1980. After that there is a little decreas and this two country start to have a differents ways. The proportion of population aged 65 and older in Sweden is fluctuating and rich a pic (25%) 2040. The persent of old people in the USA stay constant (14%) from 1980 to 2020 and rising quicly (23%) during  next 20 years.\nAbsolutly contrast situation we can see in Japan. The proportion of old people aged 65 and over decrease in periods 1940-1985 from 5% to 3% and start growing after that. By 2030 the proportion of old people in Japan become equal 10%. In the next decade this proportion hardly grow up and rich a pic in 27% - the max value.\n','worst'),(88,'17_1','The chart illustrates the number of kids, who do not have access to primary education, between 2000 and 2012 dependently on their gender and region.\nGenerally speaking, the trend of changes in Africa, South Asia and the rest of the world was downwards. Obviously, the least number of children with no access to school education belongs to South Asia: 4,8 millions of boys and 5,1 millions of girls got left with no education in 2012. Moreover, South Asia is a region with the greatest progress: it experienced the most significant decrease of more then 75 per cent and 50 per cent for boys and girls respectively. The least changes are found in Africa: the number of boys with no education fell for 20 per cent approximately, while in case with girls there is a decrease for 30 per cent roughly. \nOverall, there is a stable negative tendency for children of all the regions.\n','worst'),(89,'VKo_32_2','Each of us sometimes ask a question by yourself: is there limit in my freedom to express my personal beliefs and ideas? I strongly believe that define limits should exist, because we all live in the same world and should respect beliefs and ideas of different groups of people. I understand that this is a very contradictionary question, however I have my stable personal opinion on this issue and I want to illustare it by few examples.\nFirst of all, we should understand, that the way, how we express our opinion shouldn*t hert anybody. Government should define the limits of our freedom to expression, and I think, that this is the main goal of government. Of course our government should represent all points of view on all problems, which exist in our society, and for this reason government can define the limits of our expression.\nOn the other hand, huge amount of people believe, that creative artists should always be given the freedom to express their own opinion, because it is art, and art have no limits, I can understand this people.\n','worst'),(90,'ZEv_13_2','In many countries, the student have different moral characteristic. There are a lot of kind teaching for students. For example, in arabic counties existe traditionall “teaching” when student must appreciate and respect of tradition, family, and according then in this countries good behaviour. The anothers countiest, for example – USA, terrible behaviour. Cause this country is free and democraty for tradition. \n\nFor my opinion first cause is family. It plays very important role in life everyone. Second cause is cociality. Saying tell me who are your friend so I tell you who you are. The truth! Cociality influance to person.\n\nSo I think, the parents must paying for attention to children. Very important give them right knowledghes for themself future life (in school, for example). Also the goverment must to help to spesial programmes.\n\nIn conclusion, student behaviour is modern problem. Nowadays student don’t want studying. He prefer spend to time with computer, iphone. After that he is begginning too lazy. So student behaviour hard to control. \n','worst'),(91,'ZEv_28_2','Nowadays student behaviour in schools is one of the most urgent problem of modern society in different countries. There can be really unexpectable. Many people: teachers, psychologies, doctors and parents try to understand what exactly cause severe problems with student behaviour in school. Now we try to depict what can be the reason of bad behaviour.\n\nFirst of all, the atmosphere in school. It is not a secret that because of everyday stress students feel anxiety, become nervous and have a bad mood. Also, school life is a very difficult period for students. Often they have a family problems, misunderstanding with parents, difficult relationships with classmates and so on.\n','worst'),(92,'EEm_18_2','Early universiti was only to male students. But in 20 centry opened university to female students. Now all studients studies together. In all subject we can see equal proportion of male and female.\n\nI think that in university must be separate to male and female subjectsor must be competitions among students that studie this subject. Not all subject female studient can be studie.\n\nFor example, math and economics is male subject. Most of famous people who was sucsses in this subject were men. And in future when the students will go to work the male studients much more easier to find well-peid job then female. The female studients much more successfull in creative subject as art, literature, language. This is their subject. The mind of female studients work much better in cultural subject.\n\nAs the other hand many examples when female studients as successful in math, economics and techick subject. Nowadays many women successfull.\n','worst'),(93,'EEm_28_2','Talking about history of education, it’s really hard to predict what programms will appear in the future. Nothing stay unchangeble, and educational process also changed.\n\nIs it good that only girls or boys vicited some subjects? Isnt’t it unfair? As for me, I think it is interesting to work not only with boys or girls. It hepls to create a healthy atmosphere at class room, to work with different opinions and views. Also, it is difficult to organaise the educational process in the way that will be the equal number of mele and female students in every subject.\n','worst'),(94,'DZu_40_2','Actually, I think that experience we are having during our life has more influence. Because characteristics we are born with may be changed during the learning process. Its no matter because when human is child its possible to change his character. Experience is very important.\n','worst'),(95,'KKo_18_2','I think, working in or with some communities is an important part of the adult life, so it is needed to get prepared to it during the higher education.\nFor example, students of second or higher years could work as assistants of their past teachers, helping them with checking home tasks or laboratory works. Also universities could provide programs with some corporates that are looking for good-perspective workers and are able to let them practice during their education, so these students could gain more experience in their subjects.\n','worst');
